component({
	name : "Banner",
	render : function(context) {
		
//		context.element.find(".firstParagraph").hide();
		$( document ).ready(function() {
//			context.element.find(".firstParagraph").show('none');
			if (context.datas.firstParagraphTextAnimationCss) {
				context.element.find(".firstParagraph").addClass('animated '+ context.datas.firstParagraphTextAnimationCss);
				context.element.find(".firstParagraph").one('webkitAnimationEnd mozAnimationEnd MSAnimationEnd oanimationend animationend', function(){
					context.element.find(".firstParagraph").removeClass('animated ' + context.datas.firstParagraphTextAnimationCss)
				});
			}
		});
		
		
		if (context.datas.enableParalax) {
			var speed = parseFloat(context.datas.speed);

			image = new Image();
			image.src = context.datas.imageBackgroundUrl;
			image.onload = function() {
				$(document).scroll(function() {
					
					var scrollT = $(document).scrollTop();
					var windowH = $(window).height();
					var slotH = context.element.outerHeight();
//					var imageH = context.element.find(".image").height();
					var imageH = image.naturalHeight * context.element.outerWidth() / image.naturalWidth;
					var documentT = context.element.offset().top;
					
					var scrollN = documentT + slotH/2 - windowH/2;
					
					var top = slotH/2 - imageH/2 + (scrollT - scrollN) * speed;
					
					context.element.find(".mainBanner").css("background-position-y", top + "px");
				});
			};
		}
		
	}
});
