component({
	name : "Map",
	mappyInitialized : false,
	render : function(context) {
		
		var firstClick = false;
		context.datas.counterInSuccessGeocodage = 0;
		
		// Cration de la carte
		var newMappyModulaire = new L.Mappy.Map(context.datas.mappyElementId, {
		    clientId: 'pagesjaunes',
		    viewmode: context.datas.viewmode, // 'hybrid', 'standard' ou 'photo'
		    zoomControl: {
		    	zoomSlider: true
		    },
		    logoControl: {
                dir: context.datas.mappy_images + "images/"
            },
            layersControl: {
                publicTransport: context.datas.publicTransportMenu,
                traffic: false,
                viewMode: true,
                trafficLegend: true
            }, 
            tileLayerOptions: {
                detectRetina: true
            },
            attributionControl: {
                scale: context.datas.scale
            },
		});
		
		// Pour dsactiver le scrool intempestif.
		newMappyModulaire.scrollWheelZoom.disable();
		newMappyModulaire.dragging.disable();
		newMappyModulaire.on('click', function() {
			if (!firstClick) {
				firstClick = true;
				newMappyModulaire.off('click');
				newMappyModulaire.scrollWheelZoom.enable();
				newMappyModulaire.dragging.enable();
			}
		});
		
		// Gestion de l'affichage des transports publics sur la carte.
		if (context.datas.publicTransport) {
			newMappyModulaire.layersControl.activatePublicTransport(true);
		}
		
		if (context.datas.geoCoordonnees) {
			// Vrification des lat/long des bureaux pour viter un dysfonctionnement de la carte.
			checkBureauLatLong(context, newMappyModulaire);
		}else {
			context.element.hide();
		}
	}
});


//Vrifie que tous les bureaux ont des coordonnes
function checkBureauLatLong(context, newMappyModulaire) {
	var countOfBurreauWithoutLatLong = 0;
	for (var i = 0; i < context.datas.geoCoordonnees.length; i += 1) {
		// Rcupration de la latitude et la longitude.
		var longitude = context.datas.geoCoordonnees[i].lon;
		var latitude = context.datas.geoCoordonnees[i].lat;
		
		if ((!longitude) && (!latitude)) {
			countOfBurreauWithoutLatLong++;
		}
	}
	
	// Si des Bureaux n'ont pas de coordonnes X et Y (latitude et longitude).
	if (countOfBurreauWithoutLatLong > 0) {
		initBureau(context, newMappyModulaire, countOfBurreauWithoutLatLong);
	}else {
		initMappy(context, newMappyModulaire);
	}
}

//initialise les donnes des bureaux en les gocodants.
function initBureau(context, newMappyModulaire, countOfBurreauWithoutLatLong) {
	if (countOfBurreauWithoutLatLong > 0) {
		for (var i = 0; i < context.datas.geoCoordonnees.length; i += 1) {
			// Rcupration de la latitude et la longitude.
			var longitude = context.datas.geoCoordonnees[i].lon;
			var latitude = context.datas.geoCoordonnees[i].lat;
			
			if (latitude == null || latitude == undefined || longitude == null || longitude == undefined) {
				// Pas de coordonne X et Y
				var default_address = context.datas.geoCoordonnees[i].adr1;
				var default_city = context.datas.geoCoordonnees[i].adr2;
				
				geocode(context, default_address, default_city, i, newMappyModulaire, countOfBurreauWithoutLatLong);
			}
		}
	}
}


//Gocodage pour rcupration des coordonnes.
function geocode (context, default_address, default_city, index, newMappyModulaire, countOfBurreauWithoutLatLong){
	// Callback de succs
	var onGeocodingSuccess = function(results) {
	    if (results.length > 0) {
	    	context.datas.counterInSuccessGeocodage++;
	    	context.datas.geoCoordonnees[index].lon = results[0].geometry.geometries[0].coordinates[0];
	    	context.datas.geoCoordonnees[index].lat = results[0].geometry.geometries[0].coordinates[1];
	    	if (countOfBurreauWithoutLatLong == context.datas.counterInSuccessGeocodage) {
				countOfBurreauWithoutLatLong = 0;
				context.datas.counterInSuccessGeocodage = 0;
				// Gestion de l'affichage des markers sur la carte.
				initMappy(context, newMappyModulaire);
			}
		}
	};
	 
	// Callback d'erreur
	var onGeocodingError = function(error) {
	    // Error during geocoding
		context.element.hide();
	};
	 
	// On gocode l'adresse
	L.Mappy.Services.geocodeForward(default_address + ", " + default_city, onGeocodingSuccess, onGeocodingError);
}



function initMappy(context, newMappyModulaire) {
	var longitude;
	var latitude;
	var latlng;
	var multiAdresse = false;
	var tableauxLatLong = [];
	var i;
	
	// Traitement de toutes les coordonnes
	if (context.datas.geoCoordonnees !== undefined && context.datas.geoCoordonnees.length >= 1) {
		if (context.datas.geoCoordonnees.length > 1) {
			multiAdresse = true;
		}
		for (i = 0; i < context.datas.geoCoordonnees.length; i += 1) {
			// Rcupration de la latitude et la longitude et de la projection.
			longitude = context.datas.geoCoordonnees[i].lon;
			latitude = context.datas.geoCoordonnees[i].lat;
			projection = context.datas.geoCoordonnees[i].proj;
			
			// Ajout du marker
			if (typeof context.datas.geoCoordonnees[i].url !== "undefined" && context.datas.geoCoordonnees[i].url !== "") {
				var popHTML = '<strong class="bleu">' + context.datas.geoCoordonnees[i].lab + '</strong><br/>';
				if (typeof context.datas.geoCoordonnees[i].adr1 !== "undefined" && context.datas.geoCoordonnees[i].adr1 !== "") {
					popHTML += context.datas.geoCoordonnees[i].adr1 + '<br/>';
				}
				if (typeof context.datas.geoCoordonnees[i].adr2 !== "undefined" && context.datas.geoCoordonnees[i].adr2 !== "") {
					popHTML += context.datas.geoCoordonnees[i].adr2 + '<br/>';
				}
				if (typeof context.datas.geoCoordonnees[i].tel !== "undefined" && context.datas.geoCoordonnees[i].tel !== "") {
					popHTML += '<span class="bleu">Tl.</span> :' + context.datas.geoCoordonnees[i].tel + '<br/>';
				}
				popHTML += '<a href="' + context.datas.geoCoordonnees[i].url + '#nousSituer" class="bleu">info +</a>';
			}
			L.marker([latitude, longitude]).addTo(newMappyModulaire).bindPopup(popHTML);
			
			// Gestion des cartes avec multi-contact
			if (multiAdresse) {
				tableauxLatLong.push([latitude,longitude]);
			}else {
				latlng = L.latLng(latitude, longitude);
				tableauxLatLong.push([latitude,longitude]);
			}
		}
	}
	
	// Regarder si on a des Zi ou ZoneIntervention et les affichs !!
	if (context.datas.zi !== undefined && context.datas.zi.length > 0) {
		var num  = context.datas.zi.length;
		var nbKmlTotal = calculNombreKml(context);
		var nbKmlEnCours = 0;
		for (i = 0; i < num; i++) {
			var type = context.datas.zi[i].type;
			var value = context.datas.zi[i].value;
			// fichier kml
			if (type === "region" || type === "departement" || type === "ville" || type === "arrondissement" || type === "pays") {
				getKmlFile(context, type, value, newMappyModulaire, tableauxLatLong, nbKmlEnCours == nbKmlTotal-1);
				nbKmlEnCours++;
				
			}else if (type === "cercle") {
				if (context.datas.geoCoordonnees.length > 0) {
					centre = context.datas.geoCoordonnees[0];
					longitude = centre.lon;
					latitude = centre.lat;
					projection = centre.proj;
					var Lambert2Etendu = false;
					if (projection === "Lambert2Etendu") {
						Lambert2Etendu = true;
					} else {
						coord = L.latLng(latitude, longitude);
					}
					
					if (!Lambert2Etendu) {
						var circle = L.circle(coord, value, {
						    weight: 2
						}).addTo(newMappyModulaire);
						getLatLngBounds(circle, tableauxLatLong);
					}
				}
			}else if (type === "libre") {
				if (value.length > 2) {
					var tabPolygon = [];
					var j;
					for (j = 0; j < value.length; j++) {
						tabPolygon.push(L.latLng(value[j][1], value[j][0]));
					}
					var polygon = L.polygon([tabPolygon]).addTo(newMappyModulaire);
					getLatLngBounds(polygon, tableauxLatLong);
				}
			}
		}
	}
	
	// Gestion du zoom et du centrage de la carte.
	if (multiAdresse || !multiAdresse && tableauxLatLong.length > 0 && context.datas.zi !== undefined && context.datas.zi.length > 0) {
		newMappyModulaire.fitBounds(tableauxLatLong);
	}else {
		newMappyModulaire.setView(latlng, context.datas.zoom);
	}
	
}

function calculNombreKml(context){
	var numKmls = 0;
	for (var i = 0; i < context.datas.zi.length; i++) {
		var type = context.datas.zi[i].type;
		if (type === "region" || type === "departement" || type === "ville" || type === "arrondissement" || type === "pays") {
			numKmls++;
		}
	}
	return numKmls;
}

function getKmlFile(context, type, value, newMappyModulaire, tableauxLatLong, setZoom) {

	var file = context.datas.kmlRootPath + type + '/' + (type === 'ville' ? String(value).substr(0, 2) + '/' + value : value) + '.xml';
	
	var customLayer = L.geoJson(null, {
	    style: function(feature) {
	        return { 
	        	weight: 0
	        };
	    },
		onEachFeature: function (feature, layer) {
			// Cration de la popup.
			var popup = L.popup({
				closeButton : false
			}, layer);
			// Au mouseover
			layer.on('mouseover', function (e) {
				var name;
				if (feature.properties.name.indexOf('kml_') == 0) {
					name =  value.substr(0,1).toUpperCase() + value.substr(1);
				}else {
					name = String(feature.properties.name).replace(/ \([0-9]{5}\)/, "");
				}
				popup.setContent(name).setLatLng(L.latLng(e.latlng.lat, e.latlng.lng));
				newMappyModulaire.openPopup(popup);
			});
			// Au mouseout
			layer.on('mouseout', function (e) {
				newMappyModulaire.closePopup(popup);
	        });
		}
	});
	
	// Rcupration du KML et ajout  la carte.
	var zoneInterventionLayer = omnivore.kml(file, null, customLayer).on('ready', function() {
		// Gestion du zoom final et du centrage de la carte si ajout de layers
		getLatLngBounds(zoneInterventionLayer, tableauxLatLong);
	    if (setZoom) { // TODO REM voir si on le garde ???
	    	newMappyModulaire.fitBounds(tableauxLatLong);
		}
    }).addTo(newMappyModulaire);
}

function getLatLngBounds(zone, tableauxLatLong){
	var southWest = zone.getBounds().getSouthWest();
	var northEast = zone.getBounds().getNorthEast();
	var swLat = zone.getBounds().getSouthWest().lat;
	var swLon = zone.getBounds().getSouthWest().lng;
	var neLat = zone.getBounds().getNorthEast().lat;
	var neLon = zone.getBounds().getNorthEast().lng;
    tableauxLatLong.push([swLat, swLon]);
    tableauxLatLong.push([neLat, neLon]);
}
