component({
	name : "Produit",

	render : function(context) {
		this.initProduitListeners(context);
	},
	
	initProduitListeners : function(context) {
		var produit = this;
		var idComponent = context.element.selector;
		$(document).on("change", idComponent + ' .declinaison', function() { produit.majProduit(context); });
	},
	
	majProduit : function(context) {
		paramProduit = {
			idProduit : context.element.find("input[name='idProduit']").attr("value"),
			variante1 : context.element.find("select[name='variante1'] option:selected").attr("value"),
			variante2 : context.element.find("select[name='variante2'] option:selected").attr("value"),
			variante3 : context.element.find("select[name='variante3'] option:selected").attr("value"),
			isModular : true
		}
		this.majComposantEcom(context.datas.urlMajProduit, context.element.selector + " .description", paramProduit);
	},
	
	majComposantEcom : function(url, selector, data) {
		if ($(selector).length > 0) {
			$.ajax({
				url : url,
				type : "post",
				data : data,
				error : function(data) {
					return;
				},
				success : function(data) {
					$(data).filter('script').each(function(){
			            $.globalEval(this.text || this.textContent || this.innerHTML || '');
			        });
					result = data;
					if ($(data).find(selector).length > 0) {
						result = $(data).find(selector).html();
					}
					$(selector).html(result);
	
//					initHtml();
	//				minimizeDesc();
					return;
				}
			});
		}
	}
	
});
