component({
	name : "ProduitUne",

	render : function(context) {
		var produitUne = this;
		produitUne.initProduitUneEvents(context);
		$(window).resize(function(){
			produitUne.initProduitUneEvents(context);
		});
	},
	
	initProduitUneEvents : function(context) {
		var liste = context.element.find("ul");
		
		if(liste.length>0) {
			context.element.find(".prev, .next").off();
			liste.css({left:"0px"});
			
			var vignetteWidth = 254;
			var nbVignettes = context.element.find("li").length;
			var listeVignettesWidth = nbVignettes * vignetteWidth;
			
			var containerWidth = context.element.find('.gallery').width();
			var positionMax = Math.floor((195 + listeVignettesWidth  - containerWidth) / vignetteWidth);
			liste.css({width:listeVignettesWidth+"px"});
			
			context.element.find('.next').click(function() {
				liste.stop(false,true);
				var currentPosition = Math.floor(-liste.position().left / vignetteWidth);
				if(currentPosition >= positionMax) return;
				var nextPosition = currentPosition + 1;
				liste.stop(false,true).animate({'left':-nextPosition*vignetteWidth},600);
			});
			context.element.find('.prev').click(function(){
				liste.stop(false,true);
				var currentPosition = Math.floor(-liste.position().left / vignetteWidth);
				if(currentPosition <= 0) return;
				var nextPosition = currentPosition - 1;
				liste.stop(false,true).animate({'left':-nextPosition*vignetteWidth},600);
			});
			
			var vignetteRight = positionMax * vignetteWidth;
			var arrayVign = new Array(
					liste.eq(0).offset().left - vignetteRight,
					0,
					liste.eq(0).offset().left,
					500);
	
			liste.draggable({ 
				axis: "x",
				start: function(event, ui) { },
				stop: function(event, ui) { },
				drag: function(event, ui) { }
				,"containment": arrayVign
			});
		}
	}

});
