component({
	name : "SAP",
	render : function(context) {
		
		// url d'appel
		var urlProximite = context.datas.sapUrl + '/' + ($("meta[content=en]").length === 1 ? 'en' : 'fr') + '/light/' + context.datas.pviOda;
		$.ajax({
			url : urlProximite,
			type : "GET",
			dataType : "xml",
			success : function(data) {
				var doc = $(data);
				var pvi = doc.find("pvi");
				if (pvi.length > 0) {
					var html = '';
					pvi.each(function() {
						var $this = $(this);
						var nom = $this.attr("name");
						var href = $this.attr("url");
						if (nom !== "" && href !== "") {
							var dist = parseFloat($this.attr("distance"));
							var acti = $this.find("activity");

							html += '<li>';

							html += '<a class="commons-link" title="' + nom.replace(/\"/, "''") + '" href="http://' + href + '" target="_blank">' + nom + '</a>' + (!isNaN(dist) ? ' <span>[' + dist + 'Km]</span>' : '');

							if (acti.length > 0) {
								var actiNom = '';
								acti.each(function() {
									actiNom += (actiNom !== '' ? ', ' : '') + $(this).attr("name");
								});
								html += '<br/>' + context.datas.SAP + ' : ' + actiNom;
							}
							html += '</li>';
							
						}
					});
					if (html !== "") {
						context.element.find('.shape-component').append('<ul>' + html + '</ul>');
					} else {
						context.element.hide();
					}
				} else {
					context.element.hide();
				}
			},
			error : function() {
				context.element.hide();
			}
		});
		
		
	}
});

