	searchEvents : function(context) {
		var thisMoto = this;
		context.element.find(".popinalert").off('click');
		context.element.find(".popinalert").click(function(e){ 
			e.preventDefault();
			var localite = context.element.find(".auto-filtre .localite").val();
			var nbPieces = context.element.find(".auto-filtre .nbrspieces").val();
			var typeBien = context.element.find(".typeBien").val();
			var prixMax = $.trim(context.element.find("input[name=prix]").val());
			var surfaceMin = $.trim(context.element.find("input[name=surface]").val());
			var nbVehiculesAffiches = context.element.find(".pageqty").val();
			
			// vrification des types des champs
			var alerte = "";
			var pattern = /^[0-9,]+$/g;
			if (pattern.exec(surfaceMin) == null && surfaceMin !== "") {
				alerte += context.datas.surfaceMin + "\n";
			}
			pattern = /^[0-9,]+$/g;
			if (pattern.exec(prixMax) == null && prixMax !== "") {
				alerte += context.datas.prixMax + "\n";
			}
			
			// affichage d'un message d'erreur si besoin
			if (alerte !== "") {
				alert(alerte);
				return false;
			}
			
			// sauvegarde des critres de recherche
			$.ajax({
				url : context.datas.urlSaveRecherche,
				data : {modular:true, localite:localite, type:typeBien, prixMax:prixMax, surfaceMin:surfaceMin, nbVehiculesAffiches:nbVehiculesAffiches, typeRequete:2},
				type : "post",
				error: function() { },
				success : function(data) {
					// ouverture de le popup d'alerte
					popin({url : context.datas.alerteUrl + "?isModular=true", width : 700, height : "auto", onSuccess : function() {
						$(".marqueAlerte").off('change');
						$(".marqueAlerte").change(function(event) { 
							thisMoto.majModeleAlerte(context);
						});
					}});
					resetCaptcha();
					
					$("#alerteMotoform").submit(function () {
						if (!thisMoto.validFormEnvoyerAlerteMoto(context)) {
							return false;
						}
				    });
				}
			});
	
	
			return false;
		});
	
		context.element.find(".search").off('click');
		context.element.find('.search').click(function(event) {
			event.stopPropagation();
			thisMoto.searchMoto(context);
		});
		
	}
