component({
	name : "Slider",

	disableResizeEvent : true,

	render : function(context) {
		var fotorama;
		var fotoramaDiv = context.element.find('.fotorama');
//		var initialWidth = $(document).width();
		var ratio;
		if(context.datas.dataRatio === undefined) {
			var thumbsHeight = context.datas.thumbs?68:0;
			var componentHeight = context.element.find(".shape-component").height();
			var photosWidth = context.element.find(".shape-component").width();
			var photosHeight = componentHeight - thumbsHeight;
			ratio = photosWidth/photosHeight;
		} else {
			ratio = context.datas.dataRatio;
			context.element.find(".shape-component").css("width", ""+context.element.find(".shape-component").width());
		}
		var fotoramaObj = fotoramaDiv.fotorama({
			data: context.datas.images,
			ratio:ratio
		});
		fotorama = fotoramaObj.data('fotorama');

		context.element.find('.fotorama').on('fotorama:load', function (e, fotorama) {
			context.element.find('.fotorama__caption__wrap').css('opacity', '0.7');
		});
		

		fotoramaDiv.on("fotorama:fullscreenenter", function() {
			context.component.disableResizeEvent = true;
		});
		fotoramaDiv.on("fotorama:fullscreenexit", function() {
			context.component.disableResizeEvent = true;
		});

		$(window).resize(function() {
			if(context.component.disableResizeEvent) {
				return;
			}
			context.element.find(".shape-component").css("width", "auto");
			if(this.resizeTO) {
				clearTimeout(this.resizeTO);
			}
			this.resizeTO = setTimeout(function() {
				$(this).trigger('resizeEnd');
			}, 500);
		});
		$(window).bind('resizeEnd', function() {
			fotorama.destroy();
			var thumbsHeight = context.datas.thumbs?68:0;
			var componentHeight = context.element.find(".shape-component").height();
			var photosWidth = context.element.find(".shape-component").width();
			var photosHeight = context.datas.dataRatio === undefined?(componentHeight - thumbsHeight) : (photosWidth / context.datas.dataRatio);
			fotoramaObj = fotoramaDiv.fotorama({
				data: context.datas.images,
//				ratio:ratio
				width: photosWidth,
				height: photosHeight
			});
			fotorama = fotoramaObj.data('fotorama');
		});
	}
});
